import React from "react";
import { Paper, Card, Grid } from "@material-ui/core";

function Question() {
  return (
    <Paper
      style={{
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 80%",
        backgroundImage: `url("/assets/bg-2.jpg")`,
        paddingTop: "5em",
        paddingBottom: "1em",
        boxShadow: "none",
      }}
    >
      <h3 className="text-white text-center">Got a Question?</h3>
      <Grid container spacing={2}>
        <Grid item md={3}></Grid>
        <Grid container md={6}>
          <Grid item md={6}>
            12
          </Grid>
          <Grid item md={6}>
            34
          </Grid>
        </Grid>
        <Grid item md={3}></Grid>
      </Grid>
    </Paper>
  );
}

export default Question;
